import React, {lazy,Suspense} from "react";
import {Routes, Route} from 'react-router-dom';
import Ui_Layout from "../compoents/Layout";
import Loader from "../compoents/Loader";

const Certificate = lazy(() => import('../view/app/Certificate'));
const Courses = lazy(() => import('../view/app/Courses'));
const Webinar = lazy(() => import('../view/app/Webinar'));
const Support = lazy(() => import('../view/app/Support'));
const About = lazy(() => import('../view/app/About'));
const Teams = lazy(() => import('../view/app/Teams'));
const Dashboard = lazy(() => import('../view/app/Dashboard'));
const Post = lazy(() => import('../view/app/Post-Modal'));
const Contact = lazy(() => import('../view/app/Contacts'));
const CoursesList = lazy(() => import('../view/app/Courses-list'));
const NotFound = lazy(() => import('../compoents/notFound/404'));


const Ui_Router = () =>{
    return (
        <Suspense fallback={<Loader/>}>
            <Routes>
                <Route path={'/'} element={<Ui_Layout/>}>
                    <Route path={'/home'} element={<Dashboard/>}/>
                    <Route path={'/courses'} element={<Courses/>}/>
                    <Route path={'/certificate'} element={<Certificate/>}/>
                    <Route path={'/webinar'} element={<Webinar/>}/>
                    <Route path={'/support'} element={<Support/>}/>
                    <Route path={'/post'} element={<Post/>}/>
                    <Route path={'/about'} element={<About/>}/>
                    <Route path={'/coursesList'} element={<CoursesList/>}/>
                    <Route path={'/teams'} element={<Teams/>}/>
                    <Route path={'/contact'} element={<Contact/>}/>
                </Route>
                <Route path='*' element={<NotFound/>}/>
            </Routes>
        </Suspense>
    )
}

export default Ui_Router;
